import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

export default function SearchPatients() {
    const [listOfPatients, setListofPatients] = useState([]);
     let navigate = useNavigate(); 




    useEffect(() => {
      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        setListofPatients(response.data);
      })

      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        console.log(response.data.length);
      })

    }, []);
  
    return(
      <table className='h-lvh w-5/6 overflow-auto table-auto border border-slate-500'>
        <thead>
          <tr className="uppercase w-lvw">
            <th>Id</th>
            <th>Name</th>
            <th>Sex</th>
            <th>Location</th>
            <th>PhoneNumber</th>
          </tr>
        </thead>
        <tbody>
          {listOfPatients.map((value, key) => {
            return(
              <tr onClick={() => navigate(`/patientsinfo/${value.id}`)}>
                <td>{value.id}</td>
                <td>{value.firstName} {value.lastName}</td>
                <td>{value.sex}</td>
                <td>{value.location}</td>
                <td>{value.phoneNumber}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    )
}
